opyright";i:0;s:10:"vod_points";i:0;s:15:"vod_points_play";i:0;s:15:"vod_points_down";i:0;s:8:"vod_hits";i:450;s:12:"vod_hits_day";i:553;s:13:"vod_hits_week";i:166;s:14:"vod_hits_month";i:870;s:12:"vod_duration";s:0:"";s:6:"vod_up";i:569;s:8:"vod_down";i:79;s:9:"vod_score";s:3:"1.0";s:13:"vod_score_all";i:148;s:13:"vod_score_num";i:148;s:8:"vod_time";i:1562998594;s:12:"vod_time_add";i:1562996870;s:13:"vod_time_hits";i:0;s:13:"vod_time_make";i:0;s:10:"vod_trysee";i:0;s:13:"vod_douban_id";i:0;s:16:"vod_douban_score";s:3:"0.0";s:9:"vod_reurl";s:0:"";s:11:"vod_rel_vod";s:0:"";s:11:"vod_rel_art";s:0:"";s:7:"vod_pwd";s:0:"";s:11:"vod_pwd_url";s:0:"";s:12:"vod_pwd_play";s:0:"";s:16:"vod_pwd_play_url";s:0:"";s:12:"vod_pwd_down";s:0:"";s:16:"vod_pwd_down_url";s:0:"";s:11:"vod_content";s:2145:"贵妃醉酒又名《百花亭》，源于乾隆时一部地方戏《醉杨妃》的京剧剧目，该剧经京剧大师梅兰芳倾尽毕生心血精雕细刻、加工点缀，是梅派经典代表剧目之一此剧本主要描写杨玉环醉后自赏怀春的心态，表演色情，格调低俗。20世纪50年代，梅兰芳去芜存精，从人物情感变化入手，从美学角度纠正了它的非艺术倾向。剧中，杨玉环的饮酒从掩袖而饮到随意而饮，梅兰芳以外形动作的变化来表现这个失宠贵妃从内心苦闷、强自作态到不能自制、沉醉失态的心理变化过程。繁重的舞蹈举重若轻，像衔杯、卧鱼、醉步、扇舞等身段难度甚高，演来舒展自然，流贯着美的线条和韵律[1]。可惜梅兰芳拍摄京剧电影《贵妃醉酒》时虽然功力深厚，毕竟已年过花甲，对高难度动作有所改动。所幸梅派艺术后继有人，令该剧仍然常演常新。剧源何处有资料说此剧源自昆曲剧目，由其唱词结构可见一斑，尤已开场的[四平调]为京剧珍品。该剧的突出特征是载歌载舞，通过优美的歌舞动作，细致人微地将杨贵妃期盼、失望、孤独、怨恨的复杂心情一层层揭示出来。如杨贵妃前后三次的饮酒动作，便各有不同：第一次是用扇子遮住酒杯缓缓地啜；第二次是不用扇子遮而快饮；第三次是一仰而尽。之所以如此，是因为开始时她还怕宫人窃笑，因而故作矜持，掩饰着内心的苦闷；但酒入愁肠愁更愁，最后到酒已过量时，心中的懊恼、嫉恨、空虚……便一股脑地倾泄出来。再如三次“衔杯”的动作，也将杨贵妃从初醉到醺醺醉意细致入微地表现出来。这些歌舞化的动作，也体现出杨贵妃骄纵任性和放浪的性格内核。京剧中的诸多旦角流派以及各地方剧种也有此剧的演出，但从流行程度而言均无法与梅兰芳相比肩，即便是曾有评论认为的“南欧北梅”（据称梅是美中见醉，欧是醉中见美）的欧阳予倩的版本亦未能真正流传下来。";s:13:"vod_play_from";s:17:"gqm3u8$$$subom3u8";s:15:"vod_play_server";s:7:"no$$$no";s:13:"vod_play_note";s:3:"$$$";s:12:"vod_play_url";s:153:"高清在线$https://gaqoqingv.jongta.com/2018/05/13/JUKrq9AHRauzCTbh/playlist.m3u8$$$HD高清$https://www.hongxinhuaxue.com/20190106/rwQoStle/index.m3u8";s:13:"vod_down_from";s:0:"";s:15:"vod_down_server";s:0:"";s:13:"vod_down_note";s:0:"";s:12:"vod_down_url";s:0:"";s:4:"type";a:18:{s:7:"type_id";i:11;s:9:"type_name";s:9:"剧情片";s:7:"type_en";s:10:"juq